description:
Oferim servicii închirieri de utilaje terasiere si autobasculante, cap tractor cu semieremorca scmitz pentru lucrari de constructii (excavatii, terasamente, decopertari, demolari).

De asemenea, vindem cu transport inclus agregate si nisip/pietris la preturi avantajoase.

- piatra sparta diferite sorturi;
- pamant galben;
- raniță + pamant negru;

Facem livrari și inafara orasului Galati.

